import React from 'react';
import Edu1 from './Edu1';
import Edu2 from './Edu2';
import Edu3 from './Edu3';

import './Education.css';

const Education = () => {
    return (
        <div 
            className='education-page'
            style={{
                display: 'flex',
                flexDirection: 'row',
                flexWrap: 'wrap',
                alignContent: 'center',
                justifyContent: 'center',
            }}
        >
            <Edu1 />
            <Edu2 />
            <Edu3 />
        </div>
    )
}

export default Education;
